from biom.parse import parse_biom_table
from cogent.util.unit_test import TestCase, main
from evident.rarefaction import (build_color_preferences, single_object_alpha,\
                                get_rarefactions, _format_rarefactions,\
                                generate_alpha_rarefaction_plots_from_point_in_omega)

class TopLevelTests(TestCase):
    def setUp(self):
        self.mapping_file_data = mapping_file_data
        self.mapping_file_headers = ['SampleID', 'BarcodeSequence',\
                                    'LinkerPrimerSequence', 'Treatment',\
                                    'DOB', 'Description']
        self.mapping_file_tuple = (self.mapping_file_data,\
            self.mapping_file_headers)

        self.biom_object = parse_biom_table(input_biom_table)
        self.tree_object = parse_newick(gg_tree_string)

        self.metrics = ['observed_species','Chao1', 'PD_whole_tree']

        # make tests consisten with the seed always being the same
        seed(111)

    def test_build_color_preferences(self):
        """check preferences are created correctly"""
        # generic test with no special settings
        out_color_preferences, out_data, out_background_color, out_label_color =\
            build_color_preferences(self.mapping_file_tuple)

        expected_color_preferences = {\
            'Description': {'column': 'Description'},\
            'DOB': {'column': 'DOB'},\
            'BarcodeSequence': {'column': 'BarcodeSequence'},\
            'SampleID': {'column': 'SampleID'},\
            'LinkerPrimerSequence': {'column': 'LinkerPrimerSequence'},\
            'Treatment': {'column': 'Treatment'}\
            }
        expected_data =  {\
            'map': \
            [['SampleID', 'BarcodeSequence', 'LinkerPrimerSequence', 'Treatment', 'DOB', 'Description'],\
            ['PC.354', 'AGCACGAGCCTA', 'YATGCTGCCTCCCGTAGGAGT', 'Control', '20061218', 'Control_mouse_I.D._354'],\
            ['PC.355', 'AACTCGTCGATG', 'YATGCTGCCTCCCGTAGGAGT', 'Control', '20061218', 'Control_mouse_I.D._355'],\
            ['PC.356', 'ACAGACCACTCA', 'YATGCTGCCTCCCGTAGGAGT', 'Control', '20061126', 'Control_mouse_I.D._356'],\
            ['PC.481', 'ACCAGCGACTAG', 'YATGCTGCCTCCCGTAGGAGT', 'Control', '20070314', 'Control_mouse_I.D._481'],\
            ['PC.593', 'AGCAGCACTTGT', 'YATGCTGCCTCCCGTAGGAGT', 'Control', '20071210', 'Control_mouse_I.D._593'],\
            ['PC.607', 'AACTGTGCGTAC', 'YATGCTGCCTCCCGTAGGAGT', 'Fast', '20071112', 'Fasting_mouse_I.D._607'],\
            ['PC.634', 'ACAGAGTCGGCT', 'YATGCTGCCTCCCGTAGGAGT', 'Fast', '20080116', 'Fasting_mouse_I.D._634'],\
            ['PC.635', 'ACCGCAGAGTCA', 'YATGCTGCCTCCCGTAGGAGT', 'Fast', '20080116', 'Fasting_mouse_I.D._635'],\
            ['PC.636', 'ACGGTGAGTGTC', 'YATGCTGCCTCCCGTAGGAGT', 'Fast', '20080116', 'Fasting_mouse_I.D._636']]\
            }
        expected_background_color = 'black'
        expected_label_color = 'white'

        self.assertEquals(out_color_preferences, expected_color_preferences)
        self.assertEquals(out_data, expected_data)
        self.assertEquals(out_background_color, expected_background_color)
        self.assertEquals(out_label_color, expected_label_color)

    def test_single_object_alpha(self):
        """check rarefactions are correctly performed"""

        # simple case with the tutorial dataset
        out_calculations = single_object_alpha(self.biom_object,\
            self.metrics, self.tree_object)
        self.assertEquals(out_calculations, expected_single_object_alpha)

    def test_get_rarefactions(self):
        """check multiple rarefactions are correctly performed"""

        # test for a 6 depths rarefaction case
        expected_output = [\
            [40, 0, parse_biom_table(expected_biom_object_a)],\
            [60, 0, parse_biom_table(expected_biom_object_b)],\
            [80, 0, parse_biom_table(expected_biom_object_c)],\
            [100, 0, parse_biom_table(expected_biom_object_d)],\
            [120, 0, parse_biom_table(expected_biom_object_e)],\
            [140, 0, parse_biom_table(expected_biom_object_f)]]
        out_rarefactions = get_rarefactions(self.biom_object, 40, 140, 1, 5)
        self.assertEquals(out_rarefactions, expected_output)

    def test_format_rarefactions(self):
        """check the formatting is being performed correctly"""

        # single iteration per depth
        sample_ids = ['M9Thmr217.141049', 'M3Midl217.141103', \
            'M9Midr217.141060', 'M3Pinr217.141057']
        output = _format_rarefactions(metrics_data_a, sample_ids)
        self.assertEquals(output, expected_formated_dict_a)

        # multiple iterations per depth
        sample_ids = ['M9Thmr217.141049', 'M3Midl217.141103', \
            'M9Midr217.141060', 'M3Pinr217.141057']
        output = _format_rarefactions(metrics_data_b, sample_ids)
        self.assertEquals(output, expected_formated_dict_b)

    def test_generate_alpha_rarefaction_plots_from_point_in_omega(self):
        """check the HTML formatted string is correctly created"""

        # each output string must be split in two pieces, one containing the 
        # data from the images and the other one containing the JavaScritp and
        # HTML code. Only the former will be checked as the format of the images
        # vary from machine to machine, so the images are assumed correct
        separator_string = 'function show_hide_category(checkobject){'

        # standard deviation multile iterations
        out_html_string = generate_alpha_rarefaction_plots_from_point_in_omega(\
            self.mapping_file_tuple, self.biom_object, self.metrics, 140, 1,\
            self.tree_object, 'stddev')
        self.assertEquals(out_html_string.split(separator_string)[1],\
            expected_html_string_a)

        # standard deviation multiple iterations
        out_html_string = generate_alpha_rarefaction_plots_from_point_in_omega(\
            self.mapping_file_tuple, self.biom_object, self.metrics, 140, 3,\
            self.tree_object, 'stddev')
        self.assertEquals(out_html_string.split(separator_string)[1],\
            expected_html_string_b)

        # standard error bars multiple iterations
        out_html_string = generate_alpha_rarefaction_plots_from_point_in_omega(\
            self.mapping_file_tuple, self.biom_object, self.metrics, 140, 3,\
            self.tree_object, 'stderr')
        self.assertEquals(out_html_string.split(separator_string)[1],\
            expected_html_string_d)

        # standard error bars single iteration
        out_html_string = generate_alpha_rarefaction_plots_from_point_in_omega(\
            self.mapping_file_tuple, self.biom_object, self.metrics, 140, 1,\
            self.tree_object, 'stderr')
        self.assertEquals(out_html_string.split(separator_string)[1],\
            expected_html_string_c)

